import './App.css';
import React, { Component } from 'react'
import Navbar from './components/Navbar';
import News from './components/News';
import {
  BrowserRouter as Router,
  Switch,
  Routes,
  Route,
  Link,
} from "react-router-dom";


export default class App extends Component {

  render() {
    return (
      <Router>
        <Navbar/>
        <div className='container my-3'>
          <Routes>
            <Route exact path="/business" element={<News pagesize={20} title={"NewsMonkey - Top Headlines"} country={'us'} category={'business'}/>}/>
            <Route exact path="/sports" element={<News pagesize={20} title={"NewsMonkey - Top Headlines"} country={'us'} category={'sports'}/>}/>
            <Route exact path="/entertainment" element={<News pagesize={20} title={"NewsMonkey - Top Headlines"} country={'us'} category={'entertainment'}/>}/>
            <Route exact path="/general" element={<News pagesize={20} title={"NewsMonkey - Top Headlines"} country={'us'} category={'general'}/>}/>
            <Route exact path="/health" element={<News pagesize={20} title={"NewsMonkey - Top Headlines"} country={'us'} category={'health'}/>}/>
            <Route exact path="/science" element={<News pagesize={20} title={"NewsMonkey - Top Headlines"} country={'us'} category={'science'}/>}/>
            <Route exact path="/technology" element={<News pagesize={20} title={"NewsMonkey - Top Headlines"} country={'us'} category={'technology'}/>}/>
            <Route exact path="/" element={<News pagesize={20} title={"NewsMonkey - Top Headlines"} country={'us'} category={'general'}/>}/>
          </Routes>
        </div>
      </Router>
    )
  }
}
